import './App.css';
import AddList from './component/addElementList';
import Title from './component/title';
import SearchW from './component/searchWord';


function App () {
  const [list, setList] = useState([]);
return (
<p>
  <Title />
  <AddList list = {list}/>
  <SearchW  setList = {setList}/>
  </p>
  );
}
export default App;
